from sympy import proper_divisors
def max_divs(n: int) -> int:
    if n <= 1: return -1
    dp = {0: 0}
    for d in proper_divisors(n):
        n_dp = dict(dp)
        for s, count in dp.items():
            n_sum = s + d
            if n_sum <= n:
                n_dp[n_sum] = max(n_dp.get(n_sum, -1), count + 1)
        dp = n_dp
    return dp.get(n, -1)
print([a for n in range(1, 400) if (a := max_divs(n)) > 0]) # _Peter Luschny_, Jan 08 2026

